INSERT [dbo].[Обращения] ([ИдОбращения], [ИдКлиента], [ИдОтветственногоСотрудника], [Тема], [Описание], [Фотография], [Статус], [Оценка], [СрочноеОбращение], [Стоимость], [ДатаОбращения]) VALUES (9, 6, 3, N'Меркурий 115Ф не включается', N'После случайного падения с высоты около 1 метра кассовый аппарат Меркурий 115Ф перестал включаться. При подключении питания индикаторы не загораются, звуковых сигналов нет. Внешних повреждений корпуса не видно, но возможно повреждение внутренних компонентов. Нужен ремонт или замена.', , N'ждем оплаты', 0, 0, CAST(5200.00 AS Decimal(12, 2)), CAST(N'2025-05-05T17:16:04.630' AS DateTime))
