INSERT [dbo].[Обращения] ([ИдОбращения], [ИдКлиента], [ИдОтветственногоСотрудника], [Тема], [Описание], [Фотография], [Статус], [Оценка], [СрочноеОбращение], [Стоимость], [ДатаОбращения]) VALUES (10, 7, 4, N'Атол 90Ф не видит сканер', N'После обновления прошивки до версии 2.15 кассовый аппарат Атол 90Ф перестал распознавать сканер штрих-кодов. Сканер подключен правильно, на других аппаратах работает. Откат к предыдущей версии ПО не решает проблему. Требуется настройка или замена драйверов.', , N'завершено', 4.5, 0, CAST(2200.00 AS Decimal(12, 2)), CAST(N'2025-05-02T17:16:04.630' AS DateTime))
GO
INSERT [dbo].[Обращения] ([ИдОбращения], [ИдКлиента], [ИдОтветственногоСотрудника], [Тема], [Описание], [Фотография], [Статус], [Оценка], [СрочноеОбращение], [Стоимость], [ДатаОбращения]) VALUES (11, 8, NULL, N'Касби 02К: не работают кнопки', N'На кассовом аппарате Касби 02К перестали реагировать кнопки "1", "4" и "7". Остальные работают нормально. Проблема появилась постепенно - сначала кнопки срабатывали через раз, теперь не работают совсем. Вероятно, требуется чистка или замена клавиатурной панели.', NULL, N'новое', 0, 0, NULL, CAST(N'2025-05-10T17:16:04.630' AS DateTime))
GO
INSERT [dbo].[Обращения] ([ИдОбращения], [ИдКлиента], [ИдОтветственногоСотрудника], [Тема], [Описание], [Фотография], [Статус], [Оценка], [СрочноеОбращение], [Стоимость], [ДатаОбращения]) VALUES (12, 9, 5, N'Viki Print не связ. с ОФД', N'Кассовый аппарат Viki Print 57Ф не отправляет данные в ОФД уже 2 дня, выдает ошибку 411. Интернет работает, другие устройства в сети онлайн. Попытки перерегистрации не помогли. Срок действия ФН не истек. Требуется настройка подключения или проверка фискального накопителя.', , N'возвращено', 3, 1, CAST(1800.00 AS Decimal(12, 2)), CAST(N'2025-04-30T17:16:04.630' AS DateTime))
GO
