CREATE PROCEDURE [dbo].[Авторизация] 
    @Логин VARCHAR(200),
	@Пароль NVARCHAR(255)
AS
BEGIN
	SET NOCOUNT ON;     
	
    DECLARE @Результат BIT = 0, @Ид AS INT, @Position AS NVARCHAR(200);
    
    SELECT @Результат = 1, @Ид = c.ИдКлиента, @Position = ''
	FROM dbo.ПользователиКлиентов as c
	WHERE c.Логин = @Логин AND c.Пароль = @Пароль

	if @Результат = 0
		SELECT @Результат = 1, @Ид = c.ИдСотрудника, @Position = s.Должность
		FROM dbo.ПользователиСотрудников as c
			INNER JOIN dbo.Сотрудники AS s ON s.ИдСотрудника = c.ИдСотрудника
		WHERE c.Логин = @Логин AND c.Пароль = @Пароль

	SELECT @Ид AS UserId, @Position AS Position
END;
GO
