CREATE PROCEDURE [dbo].[ЗаявкиКлиента]
    @Условие NVARCHAR(200),
	@Ид AS INT
AS
BEGIN
	SET NOCOUNT ON;     
	
	SELECT o.ИдОбращения AS Id, 
		   o.Тема AS Theme, 
		   o.Описание AS [Description], 
		   o.Фотография AS ImageBytes, 
		   o.Статус AS [Status], 
		   o.Оценка AS Score, 
		   CAST(IIF(Visible.r IS NOT NULL, 1, 0) AS BIT) AS IsVisible, 
		   o.СрочноеОбращение AS IsFire, 
		   o.Стоимость AS Price, 
		   o.ДатаОбращения AS DateCreate, 
		   o.ИдОтветственногоСотрудника AS WorkerId, 
		   CONCAT(s.Фамилия, N' ', s.Имя) AS WorkerFullName
	into #list
	FROM dbo.Обращения AS o
		LEFT JOIN dbo.Сотрудники AS s ON o.ИдОтветственногоСотрудника = s.ИдСотрудника
		OUTER APPLY (SELECT TOP 1 1 as r FROM dbo.СообщенияСотрудника AS cc WHERE cc.ИдОбращения = o.ИдОбращения AND cc.Просмотрено = 0) as Visible
	WHERE o.ИдКлиента = @Ид

	if @Условие = 'сортировка по статусу'
		SELECT *
		FROM #list as l
		WHERE l.Status NOT IN ('завершено')
		ORDER BY CASE l.Status WHEN 'новое' THEN 3 WHEN 'в работе' THEN 4 WHEN 'ждем оплаты' THEN 0 WHEN 'ждет оценки' THEN 1 WHEN 'возвращено' THEN 2 END ASC
	ELSE IF @Условие = 'сортировка важности'
		SELECT *
		FROM #list as l
		WHERE l.Status NOT IN ('завершено')
		ORDER BY l.IsFire DESC
	ELSE IF @Условие = 'закрытые'
		SELECT *
		FROM #list as l
		WHERE l.Status IN ('завершено')
		ORDER BY l.DateCreate DESC
	ELSE
		SELECT *
		FROM #list as l
		ORDER BY l.DateCreate DESC
END;
GO
