CREATE PROCEDURE [dbo].[ОбновленияКлиента] 
    @Имя NVARCHAR(200),
	@Фамилия NVARCHAR(200),
	@Отчество NVARCHAR(200),
	@КонтактныйТелефон VARCHAR(10),
	@КонтактныйТелефон2 VARCHAR(10) = '',
	@ПолноеНаименование NVARCHAR(300),
	@Наименование NVARCHAR(200),
	@ОГРН AS NVARCHAR(20),
	@ИНН AS NVARCHAR(20),
	@ЮридическийАдрес AS NVARCHAR(300),
	@ИдКлиента AS INT
AS
BEGIN
	SET NOCOUNT ON;            
    
	UPDATE c SET c.ИмяМенеджера = @Имя,
				c.ФамилияМенеджера = @Фамилия, 
				c.ОтчествоМенеджера = @Отчество, 
				c.КонтактныйТелефон = @КонтактныйТелефон, 
				c.КонтактныйТелефон2 = @КонтактныйТелефон2, 
				c.ПолноеНаименованиеОрганизации = @ПолноеНаименование,
				c.НаименованиеОрганизации = @Наименование, 
				c.ОГРН = @ОГРН, 
				c.ИНН = @ИНН, 
				c.ЮридическийАдресОрганизации = @ЮридическийАдрес
	FROM dbo.Клиенты as c
	WHERE c.ИдКлиента = @ИдКлиента
END;
GO
