CREATE PROCEDURE [dbo].[ПолучениеИнформацииПоКлиенту]
    @ИдКлиента AS INT
AS
BEGIN
	SET NOCOUNT ON;            
    
	SELECT		c.ИмяМенеджера AS FirstName,
				c.ФамилияМенеджера AS LastName, 
				c.ОтчествоМенеджера AS MiddleName, 
				c.КонтактныйТелефон AS Phone, 
				c.КонтактныйТелефон2 AS PhoneOther, 
				c.ПолноеНаименованиеОрганизации AS FullNameCompany,
				c.НаименованиеОрганизации AS NameCompany, 
				c.ОГРН AS OGRN, 
				c.ИНН AS INN, 
				c.ЮридическийАдресОрганизации AS CompanyAddress,
				p.Логин AS [Login],
				o.Оценка AS Score
	FROM dbo.Клиенты as c
		INNER JOIN dbo.ПользователиКлиентов AS p ON c.ИдКлиента = p.ИдКлиента
		LEFT JOIN dbo.ОценкиКлиентов AS o ON o.ИдКлиента = c.ИдКлиента
	WHERE c.ИдКлиента = @ИдКлиента
END;
GO
