CREATE PROCEDURE [dbo].[ПолучениеСообщенийПоЗаявкеКлиенту]
    @ИдОбращения AS INT
AS
BEGIN
	SET NOCOUNT ON;            
    
	SELECT sc.ИдСообщения AS IdMessage, sc.Текст AS TextMessage, sc.ДатаСообщения AS DateSendMessage, N'' as NameCompanion, CAST(sc.Просмотрено AS BIT) as IsVisible
	FROM dbo.Обращения as o
		INNER JOIN dbo.СообщенияКлиента AS sc ON o.ИдОбращения = sc.ИдОбращения
	WHERE o.ИдОбращения = @ИдОбращения 
	UNION ALL
	SELECT cc.ИдОбращения, cc.Текст, cc.ДатаСообщения, w.Фамилия + N' ' + LEFT(w.Имя, 1) + N'.', CAST(0 AS BIT) as IsVisible
	FROM dbo.Обращения as o
		INNER JOIN dbo.СообщенияСотрудника AS cc ON o.ИдОбращения = cc.ИдОбращения
		INNER JOIN dbo.Сотрудники AS w ON cc.ИдСотрудника = w.ИдСотрудника
	WHERE o.ИдОбращения = @ИдОбращения
	ORDER BY DateSendMessage DESC

	UPDATE cc SET cc.Просмотрено = 1
	FROM dbo.СообщенияСотрудника AS cc
	WHERE cc.ИдОбращения = @ИдОбращения AND cc.Просмотрено = 0
END;
