CREATE PROCEDURE [dbo].[РегистрацияКлиента] 
    @Логин VARCHAR(200),
	@Пароль NVARCHAR(255),
	@Имя NVARCHAR(200),
	@Фамилия NVARCHAR(200),
	@Отчество NVARCHAR(200),
	@КонтактныйТелефон VARCHAR(10)
AS
BEGIN
	SET NOCOUNT ON;            
    
	DECLARE @IdClient AS INT

	INSERT INTO dbo.Клиенты (ИмяМенеджера, ФамилияМенеджера, ОтчествоМенеджера, КонтактныйТелефон)
		VALUES(@Имя, @Фамилия, @Отчество, @КонтактныйТелефон)

	SET @IdClient = SCOPE_IDENTITY()

	INSERT INTO dbo.ПользователиКлиентов(ИдКлиента, Логин, Пароль)
		VALUES(@IdClient, @Логин, @Пароль)
END;
